import Signup from './components/Signup';
import './App.css';
import { createBrowserRouter, RouterProvider } from 'react-router-dom';
import HomePage from './components/HomePage';


const router = createBrowserRouter([
  {
    path:"/",
    element:<HomePage/>
  },
  {
    path:"/register",
    element:<Signup/>
  },
  {
    path:"/",
    element:<Login/>
  },
])

function App() {
  return (
    <div className="App">
      <RouterProvider router={router}/> 

    </div>
  );
}

export default App;
